  \"complete\"\n\t},\n\t{\n\t\t\"key\": \"access_constraints\",\n\t\t\"value\": \"[\"Access
  Constraints: None. Use Constraints: nThe U.S. Department of Agriculture, Natural
  Resources ConservationnService, should be acknowledged as the data source in productsnderived
  from these data.nnThis data set is not designed for use as a primary regulatory
  toolnin permitting or citing decisions, but may be used as a referencensource. This
  is public information and may be interpreted bynorganizations, agencies, units of
  government, or others based onnneeds; however, they are responsible for the appropriatenapplication.
  Federal, State, or local regulatory bodies are not tonreassign to the Natural Resources
  Conservation Service anynauthority for the decisions that they make. The Natural
  ResourcesnConservation Service will not perform any evaluations of these mapsnfor
  purposes related solely to State or local regulatory programs.nnPhotographic or
  digital enlargement of these maps to scales greaternthan at which they were originally
  mapped can cause misinterpretationnof the data. If enlarged, maps do not show the
  small areas ofncontrasting soils that could have been shown at a larger scale. Thendepicted
  soil boundaries, interpretations, and analysis derived fromnthem do not eliminate
  the need for onsite sampling, testing, andndetailed study of specific sites for
  intensive uses. Thus, these datanand their interpretations are intended for planning
  purposes only.nDigital data files are periodically updated. Files are dated, andnusers
  are responsible for obtaining the latest version of the data.n\"]\"\n\t},\n\t{\n\t\t\"key\":
